你和我都勾勾勾手\n走在小小路上很威風\n\n嘿 我們在坐小小街頭\n喔看著你又看著我\n不用說你我都很懂\n吃著冰淇淋看著你我\n\n我有我我的好的朋友\n傻傻笑笑看著你我\n沒有任何事可以阻擋你我\n        我的好的好的好的好的好的朋友\n        我的好的好的好的朋友*4\n        我的好好好好的朋友\n        我的最最好的朋友\n        我的好好好 我最好的朋友\n\n認識你都幾十年了\n我們的友誼不會變的\n看著你笑都幾十年了\n你和我之間沒人懂得\n\n什麼事情是沒走過的\n你失戀還是你結婚了\n我都在旁邊陪你走的\n開心難過都是一起的\n', '', 770, '', '可人', '可人', '', '可人', '', 0, 0, 0, '2014-05-06 16:02:28', '2015-03-12 14:07:02', '0000-00-00 00:00:00'),
