(75723, 170077, 0, 1, '回憶裡迷路的絢爛', '收錄於 高雄市政府文化局補助\n''''青春尬歌Ｉ'''' 校園原創音樂合輯', '2013-01-01 00:00:00', 2000, 19, 2, 7, '灑下 困惑 城市的記憶\n為何 走散 模糊的身影\n畏光 遼望 走出那過去\n沉默 的火光 照亮逝去\n\n逝去 記憶\n逝去 回憶\n\n我們 為何離開 為何走散 為何走失 在記憶中\n為何離開 為何走散 為何走失 在記憶中\n為何離開 為何分開 為何我迷失在記憶中\n\n我們為何離開 最後還是分開\n我們為何走散 最後還是分開\n我們為何離開 最後還是分開\n我們為何走散 最後還是分開\n\n旋轉 盼望 深邃 倔強的渴求那\n卑微 遼望 過往 回憶裡逝去的缺\n記憶無法承受混亂\n沉睡在心中的答案\n不饒過自己的卑微\n就別 追尋\n\n僅剩下寂寞往回憶裡去\n難以收拾的混亂\n\n僅剩下寂寞往回憶裡去\n難以收拾的絢爛\n\n僅剩下寂寞往回憶裡去\n回憶裡迷路的絢爛\n\n\n更多專輯＆活動資訊，請上\n\n▲愚人船Facebook粉絲專頁\nhttps://www.facebook.com/shipoffoolstw', '', 419, '', '愚人船', '梁祥御', 'whitepony', '愚人船 ', '', 1, 1, 0, '2014-05-06 18:09:10', '2015-03-12 14:07:02', '0000-00-00 00:00:00'),
