(75726, 230214, 0, 1, '夜襲 (1分鐘短版搶先聽)', '', '2014-05-10 00:00:00', 2000, 19, 2, 5, '北方的夜阿 遠山邊 燈火閃爍 \n滿城晦暗 無光 佈滿城的天空 \n無邪的臉龐 笑容天真 向善良 開了槍 \n大地瓦解成沙 \n\n是誰 裝聾做啞 \n是誰 裝傻 \n是誰 視而不見 蒙蔽了雙眼 \n\n用信念 來推翻 假文明 的 高牆 \n大聲唱 來抵抗 你的 謊言 假象 \n用自由 來解放 被囚禁的 瘋狂 \nWE''RE WAITING FOR THE SUN \n\n冬夜的薄光 透著希望 隨著風歸來啦 \n戰鼓哄㝫的 敲阿 搥阿 那虛假的面紗 \n猥瑣的臉龐 木棧道上 揮兩刀 破了相 \n戰火一觸即發 \n\n是誰 裝聾做啞 \n是誰 在裝傻 是誰 顛倒是非 模糊了真相 \n\n用信念 來推翻 謊言築 的 高牆 \n大聲唱 來抵抗 你的 虛偽 蜜糖 \n用自由 來解放 被囚禁的 瘋狂 \n請別在撒謊 \n用生命 來吹送 那滿山 的 花香 \n用信念 來修築 蜿蜒 神的城牆 \n用自由 來解放 那美麗的 故鄉 \nWE''RE WAITING FOR THE SUN \n\n月光 照亮 風夜 戰場 塵 埃安靜 如畫 \n將讓 我來 燃燒吧 爽快 交換 ', '', 60, '', '', '', '', '行李', '', 0, 1, 1, '2014-05-07 10:48:35', '2015-02-03 01:52:15', '2015-02-03 01:52:15'),
(75727, 164864, 6695, 8, 'No37.天亮', '', '2014-04-04 00:00:00', 2000, 19, 0, 5, '再過不久  天就要亮了\n你是否睡了嗎?\n當你醒來  發覺  世界又不一樣\n就打開窗  盼望一些\n再過不久  夜就要來了\n你是否聽的見\n當你發現  世界     變的又不一樣\n就關了 燈  懷念一些\n\n我知道我不應該再續舊那份諾言\n就像夏夜的冷風\n你 知道你已不再去追究那個終點\n直到最近的時候\n\n可否你來說  可否你去做\n在道義上算是什麼\n還有許多  許多的故事還想與你說\n可否你來說  可否你去做\n在道理上算是什麼\n還有許多  許多的夢想還 沒有做\n\n可否你來說….\n可否你來做…..\n可否一起做…….\n我們面對一些…', '', 155, '', '', '', '', '黃藍白', '', 0, 1, 0, '2014-05-07 12:54:12', '2015-03-12 14:07:02', '0000-00-00 00:00:00'),
(75728, 139097, 0, 1, '換日線demo', '人們追求著不同的目標 不同的人生 不同的夢想 在數不清的白天黑夜 交錯著 即使遇到了重重困難 也無法阻擋對夢想的渴望', '2014-05-07 00:00:00', 2014, 19, 1, 7, 'a1 \n在黑夜結束之前 在陽光沉沒以前\n每個期待的明天 每個懷念的從前\nb1 \n現在 我站在這戰場 面對現實和謊話\n都夠了嗎\nc1\n曾經掛在嘴上的夢想 沒有誰能夠阻擋\n是你 給我 的力量 讓我勇敢去闖\n或許生命有時不理想 也許帶來了一些絕望\n卻帶不走我的 瘋狂\na2\n如果浪漫的逃亡 只是偽造的童話\n我們活的荒唐 愛的太傻 尋找著希望\n只想換一雙翅膀\n\nc2 \n曾經掛在嘴上的夢想 沒有誰能夠阻擋\n是你 給我 的力量 讓我勇敢去闖\nc3\n未來還有多少的迷網 無助醒來 無數個天亮\n讓我 能 不害怕\n或許生命有時不理想 也許帶來了一些絕望\n卻帶不走我的 瘋狂', '', 242, '', '楊忠盛', '楊忠盛', '狄安娜', '狄安娜', '', 0, 1, 1, '2014-05-07 15:37:47', '2014-09-25 22:39:47', '2014-09-25 22:39:47'),
(75729, 139097, 0, 1, '你的世界demo', '愛情中 從習慣中的兩人世界 變成了一個人 當他收拾所有的物品 衣物 行李 和對你的愛 離開了這段關係 從今以後 我的房子 我的身旁 在也沒有他的氣味 他的聲音 我想 勇敢的飛出  你的世界', '2014-05-07 00:00:00', 2014, 19, 1, 1, '你的世界\n \n \n看見 被模糊的視線 離你越來越遠\n \n天空 都落下了眼淚 卻來不及道別\n \n我們的昨天 我們的去年 並肩走過的那一條街\n \n太多的依戀 太多的從前 一道道防線 將我包圍\n \n \n* 我往前飛 飛出你的世界\n \n愛情像一把劍 讓我 傷痕累累\n \n我不後退 掙脫回憶堡壘\n \n不做你的魁儡 不再 為你流淚\n \n \n聽見 最溫柔的聲線 殘忍中帶點美\n \n呼吸 那熟悉的氣味 沒有你的房間\n \n \n? 遺忘了所有承諾 成全後得到自由 我放手 你的愛不再擁有\n \n心碎了我還是我 雨後出現的彩虹 帶走我 最深的痛', '', 264, '', '楊忠盛', '楊忠盛', '狄安娜', '狄安娜', '', 0, 1, 1, '2014-05-07 15:38:13', '2014-09-25 22:39:43', '2014-09-25 22:39:43'),
(75730, 139097, 0, 1, '柏林圍牆', '試圖拼湊 我們的不同 像一道巨大的柏林圍牆 分割了東德和西德 分割了我和你 \n我用盡全力的 想推翻他 毀掉他 我就能在見到你', '2014-05-07 00:00:00', 2014, 19, 1, 7, '作詞者：楊忠盛(綠豆) 作曲者：楊忠盛(綠豆) \n\n想你的時候 一個人的沉默 \n安靜的拼湊 我們為何不同 \n 你衝動 我穩重 你想走 我不動 \n到最後相同理由 不一樣的夢 \n\n *推翻吧 柏林圍牆 \n隔絕了我們之間 最後的牽掛 \n 毀掉吧 柏林圍牆 \n多盼望你的臉龐 溫柔而優雅 \n I missing you around \n I missing you around\n I missing you around \n I missing you around \n\n太多的蹉跎 紛爭多過包容 \n都不在開口 冷漠分割你我傷透那一吋吋深的心窩 \n在多挽留都無法停止劇終淚已落 你遠走 \n\n *推翻吧 柏林圍牆 隔絕了我們之間 最後的牽掛\n 毀掉吧 柏林圍牆 多盼望你的臉龐\n 溫柔而優雅推翻吧推翻吧 \n I missing you around\n I missing you around \n I missing you around \n I missing you around\n', '', 242, '', '楊忠盛', '楊忠盛', '狄安娜', '狄安娜', '', 0, 1, 1, '2014-05-07 16:35:41', '2014-09-25 22:39:40', '2014-09-25 22:39:40'),
(75731, 139097, 0, 1, '無盡', '', '2014-05-07 00:00:00', 2014, 19, 1, 1, '             \n               無盡\n\n長夜裡的空白  當我獨自醒來 \n\n記憶中的人 已變得模糊不堪\n\n\n我試著想起來 那熟悉的溫暖\n\n無盡的歲月 帶走情感\n\n \n\n總是不停等待 不停徘徊\n\n一站又一站\n\n愛過的人離開 不曾間斷\n\n被時間  全部掩埋\n\n\n能不能 停留在 最美的時代\n\n那天我們笑得多燦爛\n\n\n回憶裡 你的吻 溫度還在\n\n一起說好 我會變得更勇敢\n\n\n世界忘了倒轉 人們學會期待\n\n讓逝去的愛 消失在茫茫人海\n\n我努力去記載 關於你的依賴\n\n卻無法抵擋  時間的海', '', 216, '', '', '', '', '狄安娜', '', 0, 1, 1, '2014-05-07 16:39:54', '2014-09-25 22:39:37', '2014-09-25 22:39:37'),
