(75734, 139097, 0, 1, '20歲的聖誕節', '', '2013-12-25 00:00:00', 2014, 19, 1, 10, '又到了12月 我一個人在窗邊\n \n \n不在期待他出現  回憶都變成紀念\n \n \n走在熱鬧的大街  渴望溫暖的冬夜 \n \n \n麋鹿雪人和卡片 變成狂歡的派對\n \n \n會不會 我們都回不去從前\n \n \n能不能不要都不見 \n \n \n我想再夢一遍\n \n \n \n別忘了曾經 許下的心願 \n \n \n在奇蹟的午夜 那純真的笑臉\n \n \n一整夜不睡  偷偷睜開眼\n \n \n才發現聖誕老人 原來 一直在我身邊\n \n \n \n那張問候名信片  那杯暖手的咖啡\n \n \n一起散步的公園  很靠近的恐怖片    \n \n \n一場甜蜜的約會  一次心碎的道別\n \n \n喝到天亮都宿醉  變成熟的20歲 ', '', 212, '', '', '', '', '狄安娜', '', 0, 1, 0, '2014-05-07 16:59:01', '2015-03-12 14:07:02', '0000-00-00 00:00:00'),
(75735, 239267, 6837, 1, '華麗的牢籠', '', '2014-05-07 00:00:00', 2000, 19, 0, 1, '華麗的牢籠 Lavish Cage\n\n\n詞/曲: 雷應婕 Jen L. \n\n剎那的煙火 足以讓萬人都迷惑\n別來叫醒我 還沒能夠想通 \n\n華麗的裝飾 其實是魔鬼的誘惑 \n短暫的徹底 稍縱即逝的夢 \n\n再多快樂也不夠 手握著又得到什麼 \n\n霎那間 才發現 都是貪婪的謊言 \n欲望從來不屬於自由 一座華麗牢籠\n\n誰能夠 來解救 無盡沈淪的漩渦\n滿足後瞬間的墮落 也是償還的時候 \n\n\n再多快樂也不夠 手握著又得到什麼 \n\n霎那間 才發現 都是貪婪的謊言 \n欲望從來不屬於自由 一座華麗的牢籠\n\n誰能夠 來解救 無盡沈淪的漩渦\n滿足後瞬間的墮落 也是償還的時候 \n\n\n', '', 249, '', '', '', '', '福茂唱片LINFAIR RECORDS', '', 0, 1, 0, '2014-05-07 17:05:58', '2015-03-12 14:07:02', '0000-00-00 00:00:00'),
(75736, 239267, 6837, 2, '念舊', '', '2014-05-07 00:00:00', 2000, 19, 0, 1, '念舊 Flashback\n\n詞/曲: 雷應婕 Jen.L\n\n曾經擁有過的一雙鞋\n曾經背過的那個包包\n曾經嚮往的旅行\n曾經去過的餐廳\n曾經看過的那場電影\n曾經感受過什麼是快樂\n曾經分享的音樂 \n心中秘密的森林\n捨不得丟 忘不了\n他曾是記憶中那最最的美好\n有時候念舊 也是一種情調\n捨不得丟 忘不了\n留在心裡至少證明我曾活過\n我想我 只是太念舊\n\n曾經熱血的單純夢想\n曾經迷戀過的那個對象 \n曾經談過的戀愛\n曾經流過淚的歌\n曾經熟悉的那雙溫度\n曾經體會過什麼是哀傷\n曾經接觸過的心\n曾經感動過的人\n捨不得丟 忘不了\n他曾是記憶中那最最的美好\n有時候念舊 也是一種情調\n捨不得丟 忘不了\n留在心裡至少證明我曾活過\n我想我 我只是太念舊\n捨不得丟 也忘不了\n他曾是記憶中那最最的美好\n念舊 也可以是情調 \n捨不得丟 忘不了\n留在心裡至少證明我曾活過\n別擔心 我只是念舊\n我可以念舊 因為我曾活過 \n', '', 275, '', '', '', '', '福茂唱片LINFAIR RECORDS', '', 0, 1, 0, '2014-05-07 17:09:34', '2015-03-12 14:07:03', '0000-00-00 00:00:00'),
