(75740, 81072, 6838, 1, '不該遺落的真相 / 弱肉強食', '', '2014-05-03 00:00:00', 2000, 19, 2, 9, '', '我們變得冷漠 冷靜理性被丟在角落\n我們變得盲目 真相任由謠言是非擺佈\n我們變得麻木 遺忘一遍又一遍重複\n無形傷害已經氾濫 我們早就不再只是旁觀\n\n\n這社會充滿著謊言\n又是誰承諾這一切\n一切背後只剩下騙局\n黑色巨箱將道德摧毀\n失控的民主 自由卻可悲\n他們被高傲自尊蒙蔽制約\n\n\n我們能否看清背後的故事\n不停相信被湮滅的真實 冷漠的相信\n不斷以自以為的真相控制\n真相無力再為自己解釋 沉默的秘密\n\n\n愚世智者 躲藏幕後操縱民意\n迷失沉溺 自我滿足的正義\n人性生存 失控民主花已凋零\n理性正義 我們仍然活著嗎?\n\n\n我們能否看清背後的故事\n不停相信被湮滅的真實 冷漠的相信\n不斷以自以為的真相控制\n真相無力再為自己解釋 沉默的秘密\n\n\n原諒 沒有真相如何原諒 唯有信念 讓我別再迷網\n在那背後 有太多 破碎的夢\n堅持下去 最終 等待著迎接曙光', 270, '弱肉強食', '', '', '', 'White Pony Music Studio', '', 1, 0, 0, '2014-05-07 21:07:54', '2015-03-12 14:07:03', '0000-00-00 00:00:00');
